import react from 'react';
import '@vkontakte/vkui/dist/vkui.css';
import { View, Panel, PanelHeader, FormLayout, FormLayoutGroup, Input } from '@vkontakte/vkui';

class AddSkinPanel extends React.Component {

    render() {
        return (

<View activePanel="input">
  <Panel id="input">
    <PanelHeader>
      Заполните данные
    </PanelHeader>
    <FormLayout>
      <FormLayoutGroup>
        <Input top="Ваш никнейм" />
        <Input top="Ваш игровой ID" />
      </FormLayoutGroup>
    </FormLayout>
  </Panel>
</View>
        )
    }
}
export default AddSkinPanel;
